import "./App.css";
import Header from "./components/Header";
import Logo from "../";
import Eth from "../eth.svg";
function App() {
  return (
    <header>
      <div className="leftH">
        <img src={logo} alt="logo" className="logo" />
        <div className="headerItem">Swap</div>
        <div className="headerItem">Tokens</div>


      </div>
    </header>
  
    )
}

export default App;
